import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { AuthProvider } from './context/authContext';
import PrivateRoute from './components/privateRoute';
import './App.css';
import Inicio from './components/inicio';
import AdminDashboard from './components/adminDashboard';
import ConductorDashboard from './components/conductorDashboard';
import PasajeroDashboard from './components/pasajeroDashboard';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* PÃ¡gina principal */}
          <Route path="/" element={<Inicio />} />

          {/* Rutas protegidas */}
          <Route element={<PrivateRoute allowedRoles={['admin']} />}>
            <Route path="/admin" element={<AdminDashboard />} />
          </Route>

          <Route element={<PrivateRoute allowedRoles={['conductor']} />}>
            <Route path="/conductor" element={<ConductorDashboard />} />
          </Route>

          <Route element={<PrivateRoute allowedRoles={['pasajero']} />}>
            <Route path="/pasajero" element={<PasajeroDashboard />} />
          </Route>
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
